// import { GlobalStyle, theme } from '@d3-tests/design-system';
import React from 'react';
import d3 from 'd3';
// import { ThemeProvider } from 'styled-components';

const data = [];

const App = () => {
  const square = d3
    .area()
    .x0(() => 0)
    .y0(() => 0)
    .x1(() => 10)
    .y1(() => 10);

  return <></>;
};

export default App;
